import { useEffect, useState } from "react";
import { motion } from "framer-motion";

export default function Dashboard() {
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    // extragem programările din localStorage
    const saved = JSON.parse(localStorage.getItem("bookings") || "[]");

    // normalizăm datele și sortăm de la cele mai apropiate la cele mai îndepărtate
    const sorted = saved.sort((a, b) => {
      const da = normalizeDate(a.data);
      const db = normalizeDate(b.data);
      return da - db;
    });

    setBookings(sorted);
  }, []);

  // funcție care transformă orice format de dată în obiect Date valid
  const normalizeDate = (dateStr) => {
    if (!dateStr) return new Date(0);

    let normalized = dateStr.trim();

    // 10-10-2025 sau 10/10/2025 → 2025-10-10
    if (/^\d{2}[-/]\d{2}[-/]\d{4}$/.test(normalized)) {
      const [d, m, y] = normalized.split(/[-/]/);
      normalized = `${y}-${m}-${d}`;
    }

    const d = new Date(normalized);
    return isNaN(d) ? new Date(0) : d;
  };

  // ștergere programare
  const handleDelete = (index) => {
    const confirmDelete = window.confirm("Ești sigur că vrei să ștergi această programare?");
    if (!confirmDelete) return;

    const updated = bookings.filter((_, i) => i !== index);
    setBookings(updated);
    localStorage.setItem("bookings", JSON.stringify(updated));
  };

  return (
    <section className="min-h-screen bg-[#0f0f0f] text-white py-12">
      <div className="max-w-5xl mx-auto px-6">
        <h2 className="text-4xl font-bold text-[#d4af37] mb-10 text-center">
          Programări — Panou Admin
        </h2>

        {bookings.length === 0 ? (
          <p className="text-center text-gray-400">
            Nu există programări momentan.
          </p>
        ) : (
          <div className="grid md:grid-cols-2 gap-6">
            {bookings.map((booking, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.3, delay: index * 0.05 }}
                className="bg-black/40 border border-[#d4af37]/30 rounded-xl p-6 shadow-lg hover:border-[#d4af37] transition"
              >
                <div className="flex justify-between items-center mb-4">
                  <h3 className="text-lg font-semibold text-[#d4af37]">
                    {booking.nume} {booking.prenume}
                  </h3>
                  <span className="text-sm text-gray-400">#{index + 1}</span>
                </div>

                <div className="space-y-1 text-sm">
                  <p>
                    <span className="text-gray-400">Telefon:</span>{" "}
                    {booking.telefon || "—"}
                  </p>
                  <p>
                    <span className="text-gray-400">Serviciu:</span>{" "}
                    {booking.serviciu || "—"}
                  </p>

                  <p>
                    <span className="text-gray-400">Data:</span>{" "}
                    <span className="text-white font-medium">
                      {(() => {
                        const raw = booking.data;
                        if (!raw) return "Nespecificată";

                        let normalized = raw;
                        if (/^\d{2}[-/]\d{2}[-/]\d{4}$/.test(raw)) {
                          const [d, m, y] = raw.split(/[-/]/);
                          normalized = `${y}-${m}-${d}`;
                        }

                        const date = new Date(normalized);
                        return isNaN(date)
                          ? "Dată invalidă"
                          : date.toLocaleDateString("ro-RO", {
                              weekday: "long",
                              year: "numeric",
                              month: "long",
                              day: "numeric",
                            });
                      })()}
                    </span>
                  </p>

                  <p>
                    <span className="text-gray-400">Ora:</span>{" "}
                    {booking.ora || "—"}
                  </p>
                </div>

                <div className="flex justify-end mt-4">
                  <button
                    onClick={() => handleDelete(index)}
                    className="text-red-400 hover:text-red-600 text-sm font-medium transition"
                  >
                    Șterge
                  </button>
                </div>
              </motion.div>
            ))}
          </div>
        )}
      </div>
    </section>
  );
}
